  //UseState
  const[transferencias, setTransferencias] = useState([]);

  //UseEffect
  useEffect(()=>{
  fetch("http://localhost:8080/api/transferencias")
  .then(retorno => retorno.json)
  .then(retorno_convertido => setTransferencias)
  }, []);

  //Retorno
  return (
    <div>
     <Formulario />
     <Tabela />
    </div>
  );
}

export default App;
